import React from 'react';
import './topnav.css';

const TopNav = ({ onRouteChange, isSignedIn }) => {
	if (isSignedIn) {
		return (
			<div className="topnav">
				<div className="signout" onClick={() => onRouteChange('signout')}>
				    SIGN OUT    
				 </div>
			</div>
		);
	}
}

export default TopNav;
